static final TypeCollector<Class<?>> FOR_RAW_TYPE = new TypeCollector<Class<?>>() {

    @Override
    Class<?> getRawType(Class<?> type) {
        return type;
    }

    @Override
    Iterable<? extends Class<?>> getInterfaces(Class<?> type) {
        return Arrays.asList(type.getInterfaces());
    }

    @Nullable
    @Override
