        return type.getSuperclass();
    }
};

static final TypeCollector<TypeToken<?>> FOR_GENERIC_TYPE = new TypeCollector<TypeToken<?>>() {

    @Override
    Class<?> getRawType(TypeToken<?> type) {
        return type.getRawType();
    }

    @Override
